import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import AppHeader from './components/header';
import AppLogin from './components/logingsignup.js';
import AppItinerary from './components/itinerary';

function App() {
  const isLoginPage = window.location.pathname === '/login'; // Adjust the path as needed

  return (
    <div className="App">
      {!isLoginPage && (
        <header id="header">
          <AppLogin />
        </header>
      )}
      <main>
        {isLoginPage ? <AppLogin /> : <AppItinerary />}
        {/* Add other page components as needed */}
      </main>
    </div>
  );
}

export default App;
